import React from "react";
import "./Header.css";
const Header = () => {
  return (
    <header className="header">
      <div className="nav">
      <div className="centered">Home</div>
      <div className="centered">Store</div>
      <div className="centered">About</div>
      </div>
      <button className="cart">Cart</button>
    </header>
  );
};

export default Header;
